import logo from './components/images/Octicons-mark-github.svg';
import './App.css';
import Navbar from './components/Navbar';
function App() {
  return (
          <div className="App">
            <div className ="logo">Alex<br/>Barbosa</div>
            <Navbar/>
          <img src={logo} className="App-logo" alt="logo" />
              <div id="content">
                <div id="aboutmecontent">
                </div>
              </div>           
            <footer>Copyright &copy; Alex Barbosa</footer>
          </div>
  );
}

export default App;
